// All pool images in one centralized config file
const poolImages = [
  {
    id: 1,
    src: require('Pool1.jpg').default,
    alt: "Infinity Pool with Ocean View",
    title: "Luxury Infinity Edge",
    description: "Seamless design blending with the horizon"
  },
  {
    id: 2,
    src: require('./Pool2.jpg').default,
    alt: "Modern Geometric Pool",
    title: "Contemporary Design",
    description: "Clean lines with premium finishes"
  },
  {
    id: 3,
    src: require('./Pool3.jpg').default,
    alt: "Family Pool with Waterfall",
    title: "Entertainment Ready",
    description: "Complete with natural stone waterfall"
  }
];

export default poolImages;
